<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login</title>
    <link href="assets/bootstrap/css/bootstrap.min.css" rel="stylesheet" />
    <link href="assets/css/style.css" rel="stylesheet" />

    <style>
        svg#freepik_stories-fishing:not(.animated) .animable {
            opacity: 0;
        }
    
        svg#freepik_stories-fishing.animated #freepik--background-complete--inject-36 {
            animation: 3s Infinite linear floating;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-fishing.animated #freepik--Character--inject-36 {
            animation: 6s Infinite linear floating;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-fishing.animated #freepik--Sun--inject-36 {
            animation: 6s Infinite linear heartbeat;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-fishing.animated #freepik--Plants--inject-36 {
            animation: 6s Infinite linear floating;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-fishing.animated #freepik--Birds--inject-36 {
            animation: 1.5s Infinite linear wind;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-fishing.animated #freepik--Seagull--inject-36 {
            animation: 3s Infinite linear floating;
            animation-delay: 0s;
        }
    
        @keyframes floating {
            0% {
                opacity: 1;
                transform: translateY(0px);
            }
    
            50% {
                transform: translateY(-10px);
            }
    
            100% {
                opacity: 1;
                transform: translateY(0px);
            }
        }
    
        @keyframes heartbeat {
            0% {
                transform: scale(1);
            }
    
            10% {
                transform: scale(1.1);
            }
    
            30% {
                transform: scale(1);
            }
    
            40% {
                transform: scale(1);
            }
    
            50% {
                transform: scale(1.1);
            }
    
            60% {
                transform: scale(1);
            }
    
            100% {
                transform: scale(1);
            }
        }
    
        @keyframes wind {
            0% {
                transform: rotate(0deg);
            }
    
            25% {
                transform: rotate(1deg);
            }
    
            75% {
                transform: rotate(-1deg);
            }
        }
    </style>
    
</head>

                        <h3 class="fw-light anim-logo pt-5">Fish<span class="fw-bold">Man</span></h3>
                    </div>

                    <div class="card-body d-flex flex-column justify-content-center">


                        <h3 class="card-title fw-bold text-primary mb-5">Welcome Back!</h3>
                        <p class="mb-4 text-uppercase text-muted">User Login</p>

                        <div class="input-group mb-3 px-sm-5">
                            <span class="input-group-text rounded-0" id="basic-addon1">@</span>
                            <input type="text" class="form-control form-control-dark rounded-0" placeholder="Username"
                                aria-label="Username" aria-describedby="basic-addon1">
                        </div>

                        <div class="input-group mb-3 px-sm-5">
                            <input type="password" class="form-control form-control-dark rounded-0" id="password"
                                placeholder="********">
                        </div>

                        <div class="mt-5">
                            <a href="index.html"><button type="button"
                                    class="btn btn-outline-success text-uppercase loginBtn rounded-0 px-5">Login</button></a>
                        </div>
